import React from 'react';
import axios from 'axios';
import { useEffect } from 'react';
import { NavLink } from 'react-router-dom';

function News() {
	const path = process.env.PUBLIC_URL;
	const [news, setnews] = useState([]);

	return (
		<figure id='news'>
			<div className='inner'>
				<h2>ABOUT</h2>
				<p>COFFEE BEANS & ROASTING</p>
				<div className='wrap'>
					<article></article>
				</div>
			</div>
		</figure>
	);
}

export default News;
